	if !wfs.Add(fs.NewFileListing("static/dist/paper-menu-button/paper-menu-button.html", size, mode, t, []byte("<!--\n@license\nCopyright (c) 2015 The Polymer Project Authors. All rights reserved.\nThis code may only be used under the BSD style license found at http://polymer.github.io/LICENSE.txt\nThe complete set of authors may be found at http://polymer.github.io/AUTHORS.txt\nThe complete set of contributors may be found at http://polymer.github.io/CONTRIBUTORS.txt\nCode distributed by Google as part of the polymer project is also\nsubject to an additional IP rights grant found at http://polymer.github.io/PATENTS.txt\n-->\n\n<link rel=\"import\" href=\"../polymer/polymer.html\">\n<link rel=\"import\" href=\"../iron-a11y-keys-behavior/iron-a11y-keys-behavior.html\">\n<link rel=\"import\" href=\"../iron-behaviors/iron-control-state.html\">\n<link rel=\"import\" href=\"../iron-dropdown/iron-dropdown.html\">\n<link rel=\"import\" href=\"../neon-animation/animations/fade-in-animation.html\">\n<link rel=\"import\" href=\"../neon-animation/animations/fade-out-animation.html\">\n<link rel=\"import\" href=\"../paper-styles/default-theme.html\">\n<link rel=\"import\" href=\"../paper-styles/shadow.html\">\n<link rel=\"import\" href=\"paper-menu-button-animations.html\">\n\n<!--\nMaterial design: [Dropdown buttons](https://www.google.com/design/spec/components/buttons.html#buttons-dropdown-buttons)\n\n`paper-menu-button` allows one to compose a designated \"trigger\" element with\nanother element that represents \"content\", to create a dropdown menu that\ndisplays the \"content\" when the \"trigger\" is clicked.\n\nThe child element with the class `dropdown-trigger` will be used as the\n\"trigger\" element. The child element with the class `dropdown-content` will be\nused as the \"content\" element.\n\nThe `paper-menu-button` is sensitive to its content's `iron-select` events. If\nthe \"content\" element triggers an `iron-select` event, the `paper-menu-button`\nwill close automatically.\n\nExample:\n\n    <paper-menu-button>\n      <paper-icon-button icon=\"menu\" class=\"dropdown-trigger\"></paper-icon-button>\n      <paper-menu class=\"dropdown-content\">\n        <paper-item>Share</paper-item>\n        <paper-item>Settings</paper-item>\n        <paper-item>Help</paper-item>\n      </paper-menu>\n    </paper-menu-button>\n\n### Styling\n\nThe following custom properties and mixins are also available for styling:\n\nCustom property | Description | Default\n----------------|-------------|----------\n`--paper-menu-button-dropdown-background` | Background color of the paper-menu-button dropdown | `--primary-background-color`\n`--paper-menu-button` | Mixin applied to the paper-menu-button | `{}`\n`--paper-menu-button-disabled` | Mixin applied to the paper-menu-button when disabled | `{}`\n`--paper-menu-button-dropdown` | Mixin applied to the paper-menu-button dropdown | `{}`\n`--paper-menu-button-content` | Mixin applied to the paper-menu-button content | `{}`\n\n@hero hero.svg\n@demo demo/index.html\n-->\n\n<dom-module id=\"paper-menu-button\">\n  <template>\n    <style>\n      :host {\n        display: inline-block;\n        position: relative;\n        padding: 8px;\n        outline: none;\n\n        @apply(--paper-menu-button);\n      }\n\n      :host([disabled]) {\n        cursor: auto;\n        color: var(--disabled-text-color);\n\n        @apply(--paper-menu-button-disabled);\n      }\n\n      iron-dropdown {\n        @apply(--paper-menu-button-dropdown);\n      }\n\n      .dropdown-content {\n        @apply(--shadow-elevation-2dp);\n\n        position: relative;\n        border-radius: 2px;\n        background-color: var(--paper-menu-button-dropdown-background, --primary-background-color);\n\n        @apply(--paper-menu-button-content);\n      }\n\n      :host([vertical-align=\"top\"]) .dropdown-content {\n        margin-bottom: 20px;\n        margin-top: -10px;\n        top: 10px;\n      }\n\n      :host([vertical-align=\"bottom\"]) .dropdown-content {\n        bottom: 10px;\n        margin-bottom: -10px;\n        margin-top: 20px;\n      }\n    </style>\n\n    <div id=\"trigger\" on-tap=\"toggle\">\n      <content select=\".dropdown-trigger\"></content>\n    </div>\n\n    <iron-dropdown\n      id=\"dropdown\"\n      opened=\"{{opened}}\"\n      horizontal-align=\"[[horizontalAlign]]\"\n      vertical-align=\"[[verticalAlign]]\"\n      dynamic-align=\"[[dynamicAlign]]\"\n      horizontal-offset=\"[[horizontalOffset]]\"\n      vertical-offset=\"[[verticalOffset]]\"\n      no-overlap=\"[[noOverlap]]\"\n      open-animation-config=\"[[openAnimationConfig]]\"\n      close-animation-config=\"[[closeAnimationConfig]]\"\n      no-animations=\"[[noAnimations]]\"\n      focus-target=\"[[_dropdownContent]]\"\n      allow-outside-scroll=\"[[allowOutsideScroll]]\"\n      restore-focus-on-close=\"[[restoreFocusOnClose]]\"\n      on-iron-overlay-canceled=\"__onIronOverlayCanceled\">\n      <div class=\"dropdown-content\">\n        <content id=\"content\" select=\".dropdown-content\"></content>\n      </div>\n    </iron-dropdown>\n  </template>\n\n  <script>\n    (function() {\n      'use strict';\n\n      var config = {\n        ANIMATION_CUBIC_BEZIER: 'cubic-bezier(.3,.95,.5,1)',\n        MAX_ANIMATION_TIME_MS: 400\n      };\n\n      var PaperMenuButton = Polymer({\n        is: 'paper-menu-button',\n\n        /**\n         * Fired when the dropdown opens.\n         *\n         * @event paper-dropdown-open\n         */\n\n        /**\n         * Fired when the dropdown closes.\n         *\n         * @event paper-dropdown-close\n         */\n\n        behaviors: [\n          Polymer.IronA11yKeysBehavior,\n          Polymer.IronControlState\n        ],\n\n        properties: {\n          /**\n           * True if the content is currently displayed.\n           */\n          opened: {\n            type: Boolean,\n            value: false,\n            notify: true,\n            observer: '_openedChanged'\n          },\n\n          /**\n           * The orientation against which to align the menu dropdown\n           * horizontally relative to the dropdown trigger.\n           */\n          horizontalAlign: {\n            type: String,\n            value: 'left',\n            reflectToAttribute: true\n          },\n\n          /**\n           * The orientation against which to align the menu dropdown\n           * vertically relative to the dropdown trigger.\n           */\n          verticalAlign: {\n            type: String,\n            value: 'top',\n            reflectToAttribute: true\n          },\n\n          /**\n           * If true, the `horizontalAlign` and `verticalAlign` properties will\n           * be considered preferences instead of strict requirements when\n           * positioning the dropdown and may be changed if doing so reduces\n           * the area of the dropdown falling outside of `fitInto`.\n           */\n          dynamicAlign: {\n            type: Boolean\n          },\n\n          /**\n           * A pixel value that will be added to the position calculated for the\n           * given `horizontalAlign`. Use a negative value to offset to the\n           * left, or a positive value to offset to the right.\n           */\n          horizontalOffset: {\n            type: Number,\n            value: 0,\n            notify: true\n          },\n\n          /**\n           * A pixel value that will be added to the position calculated for the\n           * given `verticalAlign`. Use a negative value to offset towards the\n           * top, or a positive value to offset towards the bottom.\n           */\n          verticalOffset: {\n            type: Number,\n            value: 0,\n            notify: true\n          },\n\n          /**\n           * If true, the dropdown will be positioned so that it doesn't overlap\n           * the button.\n           */\n          noOverlap: {\n            type: Boolean\n          },\n\n          /**\n           * Set to true to disable animations when opening and closing the\n           * dropdown.\n           */\n          noAnimations: {\n            type: Boolean,\n            value: false\n          },\n\n          /**\n           * Set to true to disable automatically closing the dropdown after\n           * a selection has been made.\n           */\n          ignoreSelect: {\n            type: Boolean,\n            value: false\n          },\n\n          /**\n           * Set to true to enable automatically closing the dropdown after an\n           * item has been activated, even if the selection did not change.\n           */\n          closeOnActivate: {\n            type: Boolean,\n            value: false\n          },\n\n          /**\n           * An animation config. If provided, this will be used to animate the\n           * opening of the dropdown.\n           */\n          openAnimationConfig: {\n            type: Object,\n            value: function() {\n              return [{\n                name: 'fade-in-animation',\n                timing: {\n                  delay: 100,\n                  duration: 200\n                }\n              }, {\n                name: 'paper-menu-grow-width-animation',\n                timing: {\n                  delay: 100,\n                  duration: 150,\n                  easing: config.ANIMATION_CUBIC_BEZIER\n                }\n              }, {\n                name: 'paper-menu-grow-height-animation',\n                timing: {\n                  delay: 100,\n                  duration: 275,\n                  easing: config.ANIMATION_CUBIC_BEZIER\n                }\n              }];\n            }\n          },\n\n          /**\n           * An animation config. If provided, this will be used to animate the\n           * closing of the dropdown.\n           */\n          closeAnimationConfig: {\n            type: Object,\n            value: function() {\n              return [{\n                name: 'fade-out-animation',\n                timing: {\n                  duration: 150\n                }\n              }, {\n                name: 'paper-menu-shrink-width-animation',\n                timing: {\n                  delay: 100,\n                  duration: 50,\n                  easing: config.ANIMATION_CUBIC_BEZIER\n                }\n              }, {\n                name: 'paper-menu-shrink-height-animation',\n                timing: {\n                  duration: 200,\n                  easing: 'ease-in'\n                }\n              }];\n            }\n          },\n\n          /**\n           * By default, the dropdown will constrain scrolling on the page\n           * to itself when opened.\n           * Set to true in order to prevent scroll from being constrained\n           * to the dropdown when it opens.\n           */\n          allowOutsideScroll: {\n            type: Boolean,\n            value: false\n          },\n\n          /**\n           * Whether focus should be restored to the button when the menu closes.\n           */\n          restoreFocusOnClose: {\n            type: Boolean,\n            value: true\n          },\n\n          /**\n           * This is the element intended to be bound as the focus target\n           * for the `iron-dropdown` contained by `paper-menu-button`.\n           */\n          _dropdownContent: {\n            type: Object\n          }\n        },\n\n        hostAttributes: {\n          role: 'group',\n          'aria-haspopup': 'true'\n        },\n\n        listeners: {\n          'iron-activate': '_onIronActivate',\n          'iron-select': '_onIronSelect'\n        },\n\n        /**\n         * The content element that is contained by the menu button, if any.\n         */\n        get contentElement() {\n          return Polymer.dom(this.$.content).getDistributedNodes()[0];\n        },\n\n        /**\n         * Toggles the drowpdown content between opened and closed.\n         */\n        toggle: function() {\n          if (this.opened) {\n            this.close();\n          } else {\n            this.open();\n          }\n        },\n\n        /**\n         * Make the dropdown content appear as an overlay positioned relative\n         * to the dropdown trigger.\n         */\n        open: function() {\n          if (this.disabled) {\n            return;\n          }\n\n          this.$.dropdown.open();\n        },\n\n        /**\n         * Hide the dropdown content.\n         */\n        close: function() {\n          this.$.dropdown.close();\n        },\n\n        /**\n         * When an `iron-select` event is received, the dropdown should\n         * automatically close on the assumption that a value has been chosen.\n         *\n         * @param {CustomEvent} event A CustomEvent instance with type\n         * set to `\"iron-select\"`.\n         */\n        _onIronSelect: function(event) {\n          if (!this.ignoreSelect) {\n            this.close();\n          }\n        },\n\n        /**\n         * Closes the dropdown when an `iron-activate` event is received if\n         * `closeOnActivate` is true.\n         *\n         * @param {CustomEvent} event A CustomEvent of type 'iron-activate'.\n         */\n        _onIronActivate: function(event) {\n          if (this.closeOnActivate) {\n            this.close();\n          }\n        },\n\n        /**\n         * When the dropdown opens, the `paper-menu-button` fires `paper-open`.\n         * When the dropdown closes, the `paper-menu-button` fires `paper-close`.\n         *\n         * @param {boolean} opened True if the dropdown is opened, otherwise false.\n         * @param {boolean} oldOpened The previous value of `opened`.\n         */\n        _openedChanged: function(opened, oldOpened) {\n          if (opened) {\n            // TODO(cdata): Update this when we can measure changes in distributed\n            // children in an idiomatic way.\n            // We poke this property in case the element has changed. This will\n            // cause the focus target for the `iron-dropdown` to be updated as\n            // necessary:\n            this._dropdownContent = this.contentElement;\n            this.fire('paper-dropdown-open');\n          } else if (oldOpened != null) {\n            this.fire('paper-dropdown-close');\n          }\n        },\n\n        /**\n         * If the dropdown is open when disabled becomes true, close the\n         * dropdown.\n         *\n         * @param {boolean} disabled True if disabled, otherwise false.\n         */\n        _disabledChanged: function(disabled) {\n          Polymer.IronControlState._disabledChanged.apply(this, arguments);\n          if (disabled && this.opened) {\n            this.close();\n          }\n        },\n\n        __onIronOverlayCanceled: function(event) {\n          var uiEvent = event.detail;\n          var target = Polymer.dom(uiEvent).rootTarget;\n          var trigger = this.$.trigger;\n          var path = Polymer.dom(uiEvent).path;\n\n          if (path.indexOf(trigger) > -1) {\n            event.preventDefault();\n          }\n        }\n      });\n\n      Object.keys(config).forEach(function (key) {\n        PaperMenuButton[key] = config[key];\n      });\n\n      Polymer.PaperMenuButton = PaperMenuButton;\n    })();\n  </script>\n</dom-module>\n"))) {
		return nil, &ErrNotAdded{Path: "$path"}
	}

