	if !wfs.Add(fs.NewFileListing("static/dist/paper-toast/paper-toast.html", size, mode, t, []byte("<!--\n@license\nCopyright (c) 2015 The Polymer Project Authors. All rights reserved.\nThis code may only be used under the BSD style license found at http://polymer.github.io/LICENSE.txt\nThe complete set of authors may be found at http://polymer.github.io/AUTHORS.txt\nThe complete set of contributors may be found at http://polymer.github.io/CONTRIBUTORS.txt\nCode distributed by Google as part of the polymer project is also\nsubject to an additional IP rights grant found at http://polymer.github.io/PATENTS.txt\n-->\n\n<link rel=\"import\" href=\"../polymer/polymer.html\">\n<link rel=\"import\" href=\"../iron-a11y-announcer/iron-a11y-announcer.html\">\n<link rel=\"import\" href=\"../iron-overlay-behavior/iron-overlay-behavior.html\">\n\n<!--\nMaterial design: [Snackbards & toasts](https://www.google.com/design/spec/components/snackbars-toasts.html)\n\n`paper-toast` provides a subtle notification toast. Only one `paper-toast` will\nbe visible on screen.\n\nUse `opened` to show the toast:\n\nExample:\n\n    <paper-toast text=\"Hello world!\" opened></paper-toast>\n\nAlso `open()` or `show()` can be used to show the toast:\n\nExample:\n\n    <paper-button on-click=\"openToast\">Open Toast</paper-button>\n    <paper-toast id=\"toast\" text=\"Hello world!\"></paper-toast>\n\n    ...\n\n    openToast: function() {\n      this.$.toast.open();\n    }\n\nSet `duration` to 0, a negative number or Infinity to persist the toast on screen:\n\nExample:\n\n    <paper-toast text=\"Terms and conditions\" opened duration=\"0\">\n      <a href=\"#\">Show more</a>\n    </paper-toast>\n\n\n### Styling\nThe following custom properties and mixins are available for styling:\n\nCustom property | Description | Default\n----------------|-------------|----------\n`--paper-toast-background-color` | The paper-toast background-color | `#323232`\n`--paper-toast-color` | The paper-toast color | `#f1f1f1`\n\nThis element applies the mixin `--paper-font-common-base` but does not import `paper-styles/typography.html`.\nIn order to apply the `Roboto` font to this element, make sure you've imported `paper-styles/typography.html`.\n\n@group Paper Elements\n@element paper-toast\n@demo demo/index.html\n@hero hero.svg\n-->\n\n<dom-module id=\"paper-toast\">\n  <template>\n    <style>\n      :host {\n        display: block;\n        position: fixed;\n        background-color: var(--paper-toast-background-color, #323232);\n        color: var(--paper-toast-color, #f1f1f1);\n        min-height: 48px;\n        min-width: 288px;\n        padding: 16px 24px;\n        box-sizing: border-box;\n        box-shadow: 0 2px 5px 0 rgba(0, 0, 0, 0.26);\n        border-radius: 2px;\n        margin: 12px;\n        font-size: 14px;\n        cursor: default;\n        -webkit-transition: -webkit-transform 0.3s, opacity 0.3s;\n        transition: transform 0.3s, opacity 0.3s;\n        opacity: 0;\n        -webkit-transform: translateY(100px);\n        transform: translateY(100px);\n        @apply(--paper-font-common-base);\n      }\n\n      :host(.capsule) {\n        border-radius: 24px;\n      }\n\n      :host(.fit-bottom) {\n        width: 100%;\n        min-width: 0;\n        border-radius: 0;\n        margin: 0;\n      }\n\n      :host(.paper-toast-open) {\n        opacity: 1;\n        -webkit-transform: translateY(0px);\n        transform: translateY(0px);\n      }\n    </style>\n\n    <span id=\"label\">{{text}}</span>\n    <content></content>\n  </template>\n\n  <script>\n    (function() {\n      // Keeps track of the toast currently opened.\n      var currentToast = null;\n\n      Polymer({\n        is: 'paper-toast',\n\n        behaviors: [\n          Polymer.IronOverlayBehavior\n        ],\n\n        properties: {\n          /**\n           * The element to fit `this` into.\n           * Overridden from `Polymer.IronFitBehavior`.\n           */\n          fitInto: {\n            type: Object,\n            value: window,\n            observer: '_onFitIntoChanged'\n          },\n\n          /**\n           * The orientation against which to align the dropdown content\n           * horizontally relative to `positionTarget`.\n           * Overridden from `Polymer.IronFitBehavior`.\n           */\n          horizontalAlign: {\n            type: String,\n            value: 'left'\n          },\n\n          /**\n           * The orientation against which to align the dropdown content\n           * vertically relative to `positionTarget`.\n           * Overridden from `Polymer.IronFitBehavior`.\n           */\n          verticalAlign: {\n            type: String,\n            value: 'bottom'\n          },\n\n          /**\n           * The duration in milliseconds to show the toast.\n           * Set to `0`, a negative number, or `Infinity`, to disable the\n           * toast auto-closing.\n           */\n          duration: {\n            type: Number,\n            value: 3000\n          },\n\n          /**\n           * The text to display in the toast.\n           */\n          text: {\n            type: String,\n            value: ''\n          },\n\n          /**\n           * Overridden from `IronOverlayBehavior`.\n           * Set to false to enable closing of the toast by clicking outside it.\n           */\n          noCancelOnOutsideClick: {\n            type: Boolean,\n            value: true\n          },\n\n          /**\n           * Overridden from `IronOverlayBehavior`.\n           * Set to true to disable auto-focusing the toast or child nodes with\n           * the `autofocus` attribute` when the overlay is opened.\n           */\n          noAutoFocus: {\n            type: Boolean,\n            value: true\n          }\n        },\n\n        listeners: {\n          'transitionend': '__onTransitionEnd'\n        },\n\n        /**\n         * Read-only. Deprecated. Use `opened` from `IronOverlayBehavior`.\n         * @property visible\n         * @deprecated\n         */\n        get visible() {\n          Polymer.Base._warn('`visible` is deprecated, use `opened` instead');\n          return this.opened;\n        },\n\n        /**\n         * Read-only. Can auto-close if duration is a positive finite number.\n         * @property _canAutoClose\n         */\n        get _canAutoClose() {\n          return this.duration > 0 && this.duration !== Infinity;\n        },\n\n        created: function() {\n          this._autoClose = null;\n          Polymer.IronA11yAnnouncer.requestAvailability();\n        },\n\n        /**\n         * Show the toast. Without arguments, this is the same as `open()` from `IronOverlayBehavior`.\n         * @param {(Object|string)=} properties Properties to be set before opening the toast.\n         * e.g. `toast.show('hello')` or `toast.show({text: 'hello', duration: 3000})`\n         */\n        show: function(properties) {\n          if (typeof properties == 'string') {\n            properties = { text: properties };\n          }\n          for (var property in properties) {\n            if (property.indexOf('_') === 0) {\n              Polymer.Base._warn('The property \"' + property + '\" is private and was not set.');\n            } else if (property in this) {\n              this[property] = properties[property];\n            } else {\n              Polymer.Base._warn('The property \"' + property + '\" is not valid.');\n            }\n          }\n          this.open();\n        },\n\n        /**\n         * Hide the toast. Same as `close()` from `IronOverlayBehavior`.\n         */\n        hide: function() {\n          this.close();\n        },\n\n        /**\n         * Called on transitions of the toast, indicating a finished animation\n         * @private\n         */\n        __onTransitionEnd: function(e) {\n          // there are different transitions that are happening when opening and\n          // closing the toast. The last one so far is for `opacity`.\n          // This marks the end of the transition, so we check for this to determine if this\n          // is the correct event.\n          if (e && e.target === this && e.propertyName === 'opacity') {\n            if (this.opened) {\n              this._finishRenderOpened();\n            } else {\n              this._finishRenderClosed();\n            }\n          }\n        },\n\n        /**\n         * Overridden from `IronOverlayBehavior`.\n         * Called when the value of `opened` changes.\n         */\n        _openedChanged: function() {\n          if (this._autoClose !== null) {\n            this.cancelAsync(this._autoClose);\n            this._autoClose = null;\n          }\n          if (this.opened) {\n            if (currentToast && currentToast !== this) {\n              currentToast.close();\n            }\n            currentToast = this;\n            this.fire('iron-announce', {\n              text: this.text\n            });\n            if (this._canAutoClose) {\n              this._autoClose = this.async(this.close, this.duration);\n            }\n          } else if (currentToast === this) {\n            currentToast = null;\n          }\n          Polymer.IronOverlayBehaviorImpl._openedChanged.apply(this, arguments);\n        },\n\n        /**\n         * Overridden from `IronOverlayBehavior`.\n         */\n        _renderOpened: function() {\n          this.classList.add('paper-toast-open');\n        },\n\n        /**\n         * Overridden from `IronOverlayBehavior`.\n         */\n        _renderClosed: function() {\n          this.classList.remove('paper-toast-open');\n        },\n\n        /**\n         * @private\n         */\n        _onFitIntoChanged: function(fitInto) {\n          this.positionTarget = fitInto;\n        }\n\n        /**\n         * Fired when `paper-toast` is opened.\n         *\n         * @event 'iron-announce'\n         * @param {{text: string}} detail Contains text that will be announced.\n         */\n      });\n    })();\n  </script>\n</dom-module>\n"))) {
		return nil, &ErrNotAdded{Path: "$path"}
	}

